  import React from 'react';
  import Auxiliary from '../../../hoc/Auxiliary/Auxiliary';
  import Button from './Button/Button';
  import './Row.css';

  const row = ({values}) => {
    return (
      <Auxiliary>
        <tr className='Row'>
          <td>{values.invoice_no}</td>
          <td>{values.name}</td>
          <td>{values.company}</td>
          <td>{values.date}</td>
          <td>{values.amount}</td>
          <td>
          <Button id={values.id} />
        </td>
        </tr>
      </Auxiliary>
    );
  };

  export default row;
